import React from 'react';
import loslagos_1 from './img/loslagos_1.png';
import loslagos_2 from './img/loslagos_2.png';

export default function Home() {

    function over(e) {
        e.currentTarget.src = loslagos_2;
    }

    function out(e) {
        e.currentTarget.src = loslagos_1;
    }


    return (
        <div className='/'>

            <img src={image} onMouseOver={over} onMouseOut={out} />
        </div>
    );
}
